import React from "react";
import GenModel from "./GenModel/GenModel";
/* import "./GenModelsHello.scss"; */


const GenModelsHello = (props) => {
  props.gen_models.models.forEach((element, index) => {
    console.log(element, index)
})

props.gen_models.models.map((anObjectMapped, index) => {
  return (
      <p key={`${anObjectMapped.name}_{anObjectMapped.email}`}>
          {anObjectMapped.name} - {anObjectMapped.email}
      </p>
  );
})
  return (
    <>

      <GenModel 
      genModelId={1} 
      genModelTitle={'XBO37/8'} 
      genModelPackaging={'DIP8 15x15x9.5 mm'} 
      genModelPicture={'xxx'}
      />

      <div> <p>GenModelsHello Props:</p>
        <pre>{JSON.stringify(props, null, 2)}</pre>
      </div>

    </>
  );
};

export default GenModelsHello;
